    "2016-04-23T02:38:02.977000",nt"name": "waterhydro-vhd",nt"isopen":
    false,nt"url": null,nt"notes": "The Vermont Hydrography Dataset (VHD) is
    compliant with the local resolution (also known as High Resolution) National Hydrography
    Dataset (NHD) and is a feature-based database that interconnects and uniquely identifies
    the stream segments or reaches that make up the nation's surface water drainage
    system. Data users are highly encouraged to read this metadata thoroughly in order
    to avoid using the data beyond its limitations. This dataset is ONLY available for
    download from USGS's FTP site as a pre-staged ESRI File Geodatabase only (shapefile
    not available). Refer to VHDCARTO if you're looking for a layer of surface water
    data for cartographic purposes only. The VHD is based primarily on the Vermont Mapping
    Program (VMP) digital orthophotos, vmp "break line" features, and to a lesser
    degree on historical surface water data, NAPP cir multi-spectral aerial photography
    and CIR satellite imagery (lamoille and white subbasins only). The original VMP
    orthos had source dates ranging from 1994-2000 and these are being updated yearly.
    The VHD is organized at the subbasin level, a.k.a., the eight digit cataloging unit
    (HUC 8). The 17 Subbasins within or intersecting Vermont include: Black-Ottauquechee
    Rivers (1080106), Connecticut-Bellows Falls to Vernon Dam (1080107), Connecticut-Johns
    River to Waits River (1080103), Connecticut-Waits River to White River (1080104),
    Deerfield River (1080203), Hudson-Hoosic Rivers (2020003), Lake Champlain (2010008),
    Lake George (2010001), Lamoille River (2010005), Middle Connecticut River (1080201),
    Mississquoi River (2010007), Otter Creek (2010002), Passumpsic River (1080102),
    St. Francois River (1110000), Upper Connecticut River (1080101), White River (1080105)
    and Winooski River (2010003).",nt"license_title": null,nt"extras": [{ntt"key":
